import './changedata.css';
import React from 'react';

function ChangeData({inputData}) {

return (
    <div className='cd-container'>
      {inputData.map((entry, index) => (
        <p key={index} className='cd-item'>{entry}</p>
      ))}
    </div>
    );
}

export default ChangeData
